import { Component, OnInit } from '@angular/core';
import { FormControl, FormGroup, ReactiveFormsModule, Validators } from '@angular/forms';

@Component({
  selector: 'register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent implements OnInit{

 reactiveForm : FormGroup;

 ngOnInit(): void {
     this.reactiveForm = new FormGroup({
      firstName : new FormControl(null,Validators.required),
      password: new FormControl(null,[Validators.required]),
      email:new FormControl(null,[Validators.required,Validators.email])
     })
 }

 OnFormSubmit(){
   console.log(this.reactiveForm);
 }

}
<div class="register-contianer">
    <div class="conatiner2">
   <h3 id="sign-up-board">Sign Up</h3>
   <form [formGroup]="reactiveForm"  (ngSubmit)="OnFormSubmit()">
      <div class="register-content">
      <label class="form-elements">
        <input type="text" placeholder="First Name*" formControlName="firstName"/>
      </label>

      <label class="form-elements">
        <input type="text" placeholder="Last Name" formControlName>
      </label>

      <label class="form-elements">
        <input type="text" placeholder="email*" size="51px"/>
      </label>

      <label class="form-elements">
        <input type="password" placeholder="password*" id="password" size="51px"/>
      </label>
      <br>
        <input type="checkbox" id="my-Checkbox" name="Checkbox"><label for="Checkbox">Remember me</label>
      <br>
      <label>
        <button type="submit" class="form-btn">Register</button>
      </label>
     </div>
   </form>

   <div class="check-login">
    <p>Are you already a member ? <a routerLink="../login">login</a></p>
   </div>
</div>
</div>
